import React from 'react';
import Image from 'react-bootstrap/Image';


const ITEM_URL = "http://ddragon.leagueoflegends.com/cdn/11.23.1/img/item"
export default function renderItemSet(props){



    return(
        <div className="itemSet">
            <div className="itemRow1 d-flex my-1 mx-1">
                <Image src={`${ITEM_URL}/${this.props.item0}.png`} className="item"/>
                <Image src={`${ITEM_URL}/${this.props.item1}.png`} className="item"/>
                <Image src={`${ITEM_URL}/${this.props.item2}.png`} className="item"/>
            </div>
            <div className="itemRow2 d-flex my-1 mx-1">
            <Image src={`${ITEM_URL}/${this.props.item3}.png`} className="item"/>
            <Image src={`${ITEM_URL}/${this.props.item4}.png`} className="item"/>
                <div className="empty"></div>
            </div>
        </div>
    );

}
